import { Link, useNavigate } from 'react-router-dom';
import './recipe-cat.css';

function Category(props){
  return(
  <li>
    <Link to='../recipe-from-cat/RecipeFromCat/'>Recipes from {props.name}</Link>
  </li>
  )
}

export default function RecipeCategory(){
